INSERT INTO `project_testdemandcontent` VALUES (577,NULL,'2024-05-16','2024-05-16',1,348,'',NULL,NULL,'使用LDRA TestBed软件和Klocwork软件工具对被测软件全部源程序进行静态分析，依据附录的审查单对源程序进行检查。1）使用静态分析工具统计软件质量度量信息，包含：（1）软件总注释率不小于20%（注释行数/软件规模*100%）；（2）模块的平均规模不大于200行（模块代码行数之和/模块数）；（3）模块的平均圈复杂度不大于10（模块圈复杂度之和/模块总数）；（4）	模块的平均扇出数不大于7（模块扇出数之和/模块总数）。2）使用静态分析工具结合人工分析对控制流和数据流进行分析，验证软件是否满足控制流和数据流要求。','对被测软件全部源程序进行静态分析，对控制流、数据流进行分析，验证软件是否满足控制流和数据流要求，并依据质量特性需求统计质量度量信息','静态分析'),(578,NULL,'2024-05-16','2024-05-16',1,349,'','','和依据附录代码审查单范围内的源代码开展四个方面的审查：1）编程准则检查：依据编程准则的要求，对程序的编码与编程准则进行符合性检查；2）代码流程审查：审查程序代码的条件判别、控制流程、数据处理等满足设计要求；3）软件结构审查：依据设计文档，审查程序代码的结构设计的合理性，包括程序结构设计和数据结构设计；4）需求实现审查：依据需求文档及其他相关资料，审查程序代码的需求层的功能实现是否正确','人工审查及借助工具辅助分析的方式','通过人工审查及借助工具辅助分析的方式开展代码审查，审查代码编程准则的符合性、代码流程实现的正确性、代码结构的合理性以及代码实现需求的正确性；人工审查中发现的问题，审查人员应及时记录','代码审查'),(579,NULL,'2024-05-16','2024-05-16',1,350,'',NULL,NULL,'测试人员人工阅读文档，依据文档检查单对软件文档进行审查，文档审查工作内容包括：1）审查软件文档内容是否完整；2）审查软件文档描述是否正确；3）审查软件文档格式是否规范；4）审查软件文档是否文文一致按照附录的需求规格说明审查单，对被测软件的需求规格说明进行审查；按照附录的软件设计文档审查单，对被测软件的设计说明文档进行审查；按照附录的用户手册审查单，对被测软件的用户手册进行审查','本软件文档审查包括内容如下：1）软件需求规格说明2）软件设计文档3）软件接口需求规格说明4）软件接口设计说明5）软件用户手册','文档审查'),(587,NULL,'2024-05-27','2024-05-27',1,355,'312','123','3','2312','12','123'),(594,NULL,'2024-05-31','2024-05-31',1,358,'条件1号','期望1号','观察1号','操作1号','测试子项描述','测试子项名称');
